  gsap.registerPlugin(ScrollTrigger);

//    
gsap.utils.toArray(".anim").forEach((element) => {
  const words = element.innerText.split(" ");
  element.innerHTML = words
    .map((word) => `<span class="word">${word}</span>`)
    .join(" ");

  gsap.fromTo(
    element.querySelectorAll(".word"),
    { color: "#767689" },
    {
      color: "#000000",
      stagger: 0.1,
      scrollTrigger: {
        trigger: element,
        start: "top 80%",
        end: "bottom 20%",
        scrub: true,
      },
    }
  );
});

  //  
  gsap.utils.toArray(".anim-open").forEach((element) => {
    gsap.fromTo(
      element,
      { opacity: 0, y: "20%" },
      {
        opacity: 1,
        y: "0%",
        duration: 0.8,
        ease: "power2.out",
        scrollTrigger: {
          trigger: element,
          start: "top 85%",
          toggleActions: "play none none none",
        },
      }
    );
  });
  
  
  //  
gsap.utils.toArray(".count").forEach((element) => {
  const target = parseFloat(element.innerText);
  const obj = { val: 0 };

  gsap.to(obj, {
    val: target,
    duration: 2,
    ease: "power2.out",
    scrollTrigger: {
      trigger: element,
      start: "top 100%",
      toggleActions: "play none none none",
    },
    onUpdate: () => {
      element.innerText = Number.isInteger(target)
        ? Math.round(obj.val)
        : obj.val.toFixed(1);
    },
  });
});
  
  



